import axios from 'axios';
import { useState, useEffect } from 'react';
import './App.css';

function App() {

  const [summoner, setSummoner] = useState([]);

  useEffect(() => {
    axios.get('https://na1.api.riotgames.com/lol/summoner/v4/summoners/by-name/FierDragon?api_key=RGAPI-dad1b46f-6da6-4063-82b2-782add95cc8c')
    .then(res => {
      console.log(res);
      setSummoner(res.data);
      console.log(summoner)
    })
    .catch((err) => console.log(err))
  }, [])

  return (
    <div className="App">
      <h1>Wow this is cool!</h1>
      <p>{summoner}</p>
    </div>
  );
}

export default App;
